import { Profile } from './components/Profile/Profile';
import user from './Profile/user.json';
import React from 'react';

export const App = () => {
  return (
    <div>
      <Profile
          username={user.username}
          tag={user.tag}
          location={user.location}
          avatar={user.avatar}
          stats={user.stats}
      />

    </div> 
  );
};
